import logo from './logo.svg';
import './App.css';

function componentDidMount() {
  // Simple POST request with a JSON body using axios
  fetch('https://api.spotify.com/v1/recommendations?limit=10&market=ES&seed_artists=4NHQUGzhtTLFvgF5SZesLK&seed_genres=classical%2Ccountry&seed_tracks=0c6xIDDpzE81m2q797ordA')
  .then(response => response.json())
  .then(data => this.setState({ totalReactPackages: data }));
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        < totalReactPackages/>
      </header>
    </div>
  );
}

export default App;
